//import Lesson from './Lesson';

export default function Main(props) {
	console.log(props.data.students);
	if (props.data) {
		const studentList = props.data.students.map((item, i) => {
			return (
				<div>
					<p>{item.name}</p>
				</div>
			);
		});
		return <main>{studentList}</main>;
	}
}
